import React from 'react';
import Navbar from './components/navbar';
import './App.css';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import button from './components/button';
import Post from './components/Post.js';

function App() {
  return (
    <Router>
    <div className="App">
     <Navbar/>
     <section className="container-fluid">
        <div className="position-body responsive">


            <div id="myBtnContainer">
                <button className="btn1 big-button" id="autocaricamento" onclick="filtra('tutto')"> Mostra Tutto</button>
                <button className="btn1 big-button" onclick="filtra('tecnologia')"> Tecnologia</button>
                <button className="btn1 big-button" onclick="filtra('musica')">Musica</button>
                <button className="btn1 big-button" onclick="filtra('videogiochi')"> Videogiochi</button>
                <button className="btn1 big-button" onclick="filtra('film')">Film-SerieTv</button>
                <button className="btn1 big-button" onclick="filtra('consigli')">Consigli</button>
            </div>
        </div>
    </section>
<Post/>
    </div>
    </Router>
  );
}

export default App;
